import Layout from './../components/Layout';

export default function Home() {
    return (<Layout>
        <select className="form-control plr-10">
            <option value="USD">USD</option>
            <option value="GBP">GBP</option>
            <option value="EUR">EUR</option>
        </select>
    </Layout>)
}
